import React from 'react';
import Webform from './Webform.js';
import renderobjects from './Webform';
import Figures from './Figures';
import { Row, Col } from 'antd';


 const HomePage = () => {
    const [renderobjects, setrenderobjects] = useState([]);  
     return (
   <Row>
         <Col span={50}>
             <Webform/>
         </Col>
         

         <Col span={50}>
             <Figures dimension={renderobjects}/>
         </Col>
    </Row>

     );
 }

 export default HomePage;
